    false,nt"url": null,nt"notes": "Data were collected by the SHOALS-1000T(Scanning
    Hydrographic Operational Airborne LidarSurvey)system which consists of an airborne
    laser transmitter/receiver with a 1kHz. bathymetric laser and a10 kHz topographic
    laser. Over 24,000 digital still frame photographs were taken simultaneously to
    LIDAR acquisition. Latitude and longitude were captured and logged with each photograph.
